    false,nt"url": null,nt"notes": "This collection of narrative reports for
    Carolina Sandhills National Wildlife Refuge summarizes refuge activities from January
    through December 1958. The report begins with a summary of weather and habitat conditions
    during the period. Wildlife including migratory birds, upland game birds, big game
    animals, fish, and furbearers is also covered. A refuge development and maintenance
    section covers physical development, farming activities, and fires. A public relations
    section outlines recreational use and refuge visitation is provided at the end of
